import React from 'react';
import {Button, Container, Stack} from 'react-bootstrap';


function Home(){
    return (
        <Container className='justify-content-start mt-5'>
            <h1 className="title" style={{fontSize: 60}}>Your delivered expectations at just one click away</h1>
            <p className="subtitle w-50 pt-2" style={{fontSize: 25, }}>Calculate your services, whether you need a new website or an update, 
            and we will deliver the product based on your needs and expectations.</p>

            <Stack direction="horizontal" gap={4} className="call-to-action mt-5">
            <Button href="#pricecalculator" style={{fontSize: 20}} variant="info">Get Started!</Button>{' '}
            <p>or get in touch with us</p>
            </Stack>
            
        </Container>
    );
}

export default Home
